script: |
  super -f tsv -I q3010.sql | sort > q3010.out

inputs:
  - name: q3010.sql
    data: |
      SELECT - cor0.col0 * - cor0.col0 + - NULLIF ( + 14, cor0.col0 ) AS col0 FROM tab2 AS cor0 GROUP BY cor0.col0, cor0.col2;
  - name: tab2

outputs:
  - name: q3010.out
    data: |
      211
      8267
      8450
